import{_ as o,c as l,o as a,ag as t}from"./chunks/framework.DWspNgDa.js";const i="/group/project/assets/2.CoUZ3GT6.png",r="data:image/png;base64,",s="/group/project/assets/3.CAYhIgaO.png",p="/group/project/assets/4.zaJbupEF.png",n="/group/project/assets/5.CYT2cl9p.png",c="/group/project/assets/6.Cf_GveJ6.png",d="/group/project/assets/7.Dk_UR6Rn.png",A="/group/project/assets/8.DwA9POW4.png",g="/group/project/assets/11.CRKztv2y.png",u="/group/project/assets/9.CCqRgCK5.png",h="/group/project/assets/10.BMZKvhyO.png",F=JSON.parse('{"title":"05 App 使用方法（App Designer）","description":"","frontmatter":{},"headers":[],"relativePath":"05_App使用.md","filePath":"05_App使用.md","lastUpdated":1766150447000}'),m={name:"05_App使用.md"};function b(v,e,C,k,_,f){return a(),l("div",null,[...e[0]||(e[0]=[t(`<h1 id="_05-app-使用方法-app-designer" tabindex="-1">05 App 使用方法（App Designer） <a class="header-anchor" href="#_05-app-使用方法-app-designer" aria-label="Permalink to &quot;05 App 使用方法（App Designer）&quot;">​</a></h1><p>本章面向“直接用 App 求解”的使用者，按“启动 → 导入数据 → 设置边界 → 求解 → 可视化/导出”的顺序说明。 若你希望在脚本中批处理或二次开发，请跳到：<a href="./06_App外用法">06_App外用法.md</a>。</p><hr><h2 id="_1-前置条件" tabindex="-1">1. 前置条件 <a class="header-anchor" href="#_1-前置条件" aria-label="Permalink to &quot;1. 前置条件&quot;">​</a></h2><ul><li>MATLAB R2019b 或更高版本（需要 App Designer）。</li><li>能正常使用 <code>graph/conncomp/shortestpath</code> 等图算法函数（用于回路识别与连通性检查）。</li></ul><hr><h2 id="_2-启动方式" tabindex="-1">2. 启动方式 <a class="header-anchor" href="#_2-启动方式" aria-label="Permalink to &quot;2. 启动方式&quot;">​</a></h2><h3 id="方式-a-安装-app-推荐" tabindex="-1">方式 A：安装 App（推荐） <a class="header-anchor" href="#方式-a-安装-app-推荐" aria-label="Permalink to &quot;方式 A：安装 App（推荐）&quot;">​</a></h3><p>仓库提供了可安装包（双击安装）：</p><ul><li><code>General Problem Solver/ui/SimpleVentilationNetworkSolver_v1.1.0.mlappinstall</code></li><li><code>General Problem Solver/ui/SimpleVentilationNetworkSolver.mlappinstall</code></li></ul><p>安装完成后，在 MATLAB 的 Apps 列表中启动。</p><h3 id="方式-b-直接运行源码-app" tabindex="-1">方式 B：直接运行源码 App <a class="header-anchor" href="#方式-b-直接运行源码-app" aria-label="Permalink to &quot;方式 B：直接运行源码 App&quot;">​</a></h3><p>在 MATLAB 命令行中：</p><div class="language-matlab vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">matlab</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">addpath(</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&#39;General Problem Solver&#39;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">);</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">NetworkSolverApp</span></span></code></pre></div><p>或直接双击打开：<code>General Problem Solver/ui/NetworkSolverApp.mlapp</code>。</p><blockquote><p>说明：<code>General Problem Solver/ui/NetworkSolverApp_exported*.m</code> 是 App Designer 导出文件，通常用于版本对比；界面修改建议在 App Designer 中完成。</p></blockquote><p><strong>成功打开的APP界面：</strong></p><p><img src="`+i+'" alt="界面示例" title="app界面展示"></p><hr><h2 id="_3-数据准备-你需要提供什么" tabindex="-1">3. 数据准备（你需要提供什么） <a class="header-anchor" href="#_3-数据准备-你需要提供什么" aria-label="Permalink to &quot;3. 数据准备（你需要提供什么）&quot;">​</a></h2><h3 id="_3-1-分支-巷道-表-branches" tabindex="-1">3.1 分支（巷道）表：<code>Branches</code> <a class="header-anchor" href="#_3-1-分支-巷道-表-branches" aria-label="Permalink to &quot;3.1 分支（巷道）表：`Branches`&quot;">​</a></h3><p>App 的表格每一行代表一条巷道（分支），核心字段为：</p><ul><li><code>ID</code>：巷道编号（求解器要求为 <code>1..B</code> 连续整数）</li><li><code>起点</code>（或 <code>from_node</code>）：起点节点编号（定义分支正方向）</li><li><code>终点</code>（或 <code>to_node</code>）：终点节点编号</li><li><code>风阻</code>（或 <code>R/resistance</code>）：风阻系数（正数）</li></ul><p>你可以通过三种方式填充表格：</p><ul><li><strong>导入 CSV</strong>：点击“导入 CSV”，选择分支 CSV 文件；</li><li><strong>添加行</strong>：点击“添加行”，在对话框中输入一条分支；</li><li><strong>直接编辑表格</strong>：双击单元格修改。</li></ul><p>CSV 模板可参考：<code>General Problem Solver/+gps/+data/branches_template.csv</code>。</p><p><img src="'+r+'" alt="CSV表格示例" title="表格示例"></p><p>本项目提供的测试文件中包含一些头文件，但<strong>不是必需的</strong>，只要含有标准表头（<strong>“branch_id,from_node,to_node,resistance”</strong>）即可。</p><h3 id="_3-2-边界条件-boundary" tabindex="-1">3.2 边界条件：<code>Boundary</code> <a class="header-anchor" href="#_3-2-边界条件-boundary" aria-label="Permalink to &quot;3.2 边界条件：`Boundary`&quot;">​</a></h3><p>App 右侧参数区填写：</p><ul><li><strong>系统总风量</strong> <code>Q_total</code>（标量，&gt;0）</li><li><strong>入风节点</strong> <code>inlet_node</code>（标量或多个节点）</li><li><strong>回风节点</strong> <code>outlet_node</code>（标量或多个节点）</li></ul><p>注意事项：</p><ul><li>入风节点与回风节点不能重叠；</li><li>节点编号必须存在于当前网络节点范围内；</li><li>多入风/多回风时，当前求解器会将 <code>Q_total</code> <strong>平均分配</strong>到各入风节点，并在各回风节点上平均抽出（详见 <code>General Problem Solver/+gps/+logic/ventilation_network_solver_generic.m</code>）。</li></ul><hr><h2 id="_4-操作流程-按按钮走一遍" tabindex="-1">4. 操作流程（按按钮走一遍） <a class="header-anchor" href="#_4-操作流程-按按钮走一遍" aria-label="Permalink to &quot;4. 操作流程（按按钮走一遍）&quot;">​</a></h2><ol><li><p><strong>导入/编辑分支数据</strong>：</p><ul><li><code>ID/from/to/R</code> 填写完整，且 <code>ID</code> 连续!</li><li><img src="'+s+'" alt="导入示例"></li><li><img src="'+p+'" alt="导入完成"></li></ul></li><li><p><strong>设置边界条件</strong>：</p><ul><li>填入 <code>Q_total</code>、入风节点、回风节点。</li><li><img src="'+n+'" alt="边界条件"></li></ul></li><li><p>（可选）<strong>调整求解器参数</strong>:</p><ul><li><code>max_iter</code>：最大迭代次数（不收敛时可增大）</li><li><code>tolerance</code>：收敛容差（精度要求更高可减小）</li><li><code>relaxation</code>：松弛因子 <code>ω</code>（振荡时可取 <code>0.5~0.8</code> 欠松弛）</li><li><code>verbose</code>：开启后会输出更详细日志，并可能自动绘图/导出</li><li><img src="'+c+'" alt="求解器参数"></li></ul></li><li><p><strong>点击“求解”</strong>：</p><ul><li>App 会先做数据校验（风阻正数、节点范围、连通性、边界守恒等）；</li><li>然后识别基本回路，进行 Hardy Cross 迭代；</li><li>过程与结果会输出到界面日志区域（TextArea）。</li><li><img src="'+d+'" alt="求解按钮" title="求解按钮"></li><li><img src="'+A+'" alt="求解结果" title="信息栏输出"></li></ul></li><li><p><strong>可视化</strong>：</p><ul><li>“绘制网络图”：展示网络拓扑（仅用于可视化，图上连线不代表求解方向）；</li><li><img src="'+g+'" alt="通风网络预览"></li><li>“柱状图”等结果图：展示各巷道风量与压降（若启用 verbose 或按界面功能触发）。</li><li><img src="'+u+'" alt="结果可视化" title="柱状图"></li></ul></li><li><p><strong>导出</strong>：</p><ul><li>“导出 CSV”：将当前表格内容导出为分支 CSV，便于复用；</li><li>结果导出：导出包含 <code>ID/起点/终点/风阻/风量/风压降</code> 等列的结果 CSV（具体列以当前导出函数为准，见 <code>General Problem Solver/+gps/+ui/export_solution_to_csv.m</code>）。</li><li>下图中表格各列依次为：“巷道ID、起点、终点、风阻、风量、风压降”</li><li><img src="'+h+'" alt="输出表格" title="结果输出表格"></li></ul></li></ol><hr><h2 id="_5-常见问题-建议先看这里" tabindex="-1">5. 常见问题（建议先看这里） <a class="header-anchor" href="#_5-常见问题-建议先看这里" aria-label="Permalink to &quot;5. 常见问题（建议先看这里）&quot;">​</a></h2><ul><li><strong>提示“网络不连通”</strong>：说明存在孤立子图；可先用“绘制网络图”定位，再补齐缺失连接。</li><li><strong>提示 <code>Branches.id</code> 必须为 <code>1..B</code></strong>：请把巷道编号整理为从 1 开始的连续整数（可在表格中修改后再导出）。</li><li><strong>不收敛/振荡</strong>：增大 <code>max_iter</code>，减小 <code>relaxation</code>，或放宽 <code>tolerance</code>；同时检查是否存在极端风阻（过大/过小）或不合理拓扑。</li></ul><hr><h2 id="_6-下一步-在-app-外复用-扩展" tabindex="-1">6. 下一步：在 App 外复用/扩展 <a class="header-anchor" href="#_6-下一步-在-app-外复用-扩展" aria-label="Permalink to &quot;6. 下一步：在 App 外复用/扩展&quot;">​</a></h2><p><strong>如果你想做批量计算、参数扫描、接入自定义绘图或把求解器嵌入别的工程，请阅读：</strong></p><ul><li><a href="./06_App外用法">06_App外用法.md</a></li><li><a href="./gps/OutAppUse">gps/OutAppUse.md</a></li><li><a href="./gps/Functions">gps/Functions.md</a></li></ul>',43)])])}const I=o(m,[["render",b]]);export{F as __pageData,I as default};
